import React, { useEffect, useState } from 'react';

const AllPlayersPicksPage = () => {
  const [availableWeeks, setAvailableWeeks] = useState([]);
  const [selectedWeek, setSelectedWeek] = useState(null);
  const [playerData, setPlayerData] = useState([]);
  const [loading, setLoading] = useState(true);

  // Load available weeks and default to current week
  useEffect(() => {
    const checkAvailableWeeks = async () => {
      const weeks = [];
      for (let i = 1; i <= 15; i++) {
        try {
          const res = await fetch(`/data/picks_week_${i}.json`);
          if (res.ok) {
            weeks.push(i);
          }
        } catch {}
      }
      setAvailableWeeks(weeks);

      try {
        const currentRes = await fetch('/data/current_week.json');
        const currentJson = await currentRes.json();
        const currentWeek = currentJson.currentWeek;
        setSelectedWeek(weeks.includes(currentWeek) ? currentWeek : weeks[weeks.length - 1]);
      } catch {
        setSelectedWeek(weeks[weeks.length - 1]);
      }
    };

    checkAvailableWeeks();
  }, []);

  // Load picks for the selected week
  useEffect(() => {
    if (selectedWeek === null) return;

    const loadPicksForWeek = async () => {
      setLoading(true);
      try {
        const res = await fetch(`/data/picks_week_${selectedWeek}.json`);
        const picksJson = await res.json();
        setPlayerData(picksJson);
      } catch (err) {
        console.error(`Error loading picks for week ${selectedWeek}:`, err);
        setPlayerData([]);
      } finally {
        setLoading(false);
      }
    };

    loadPicksForWeek();
  }, [selectedWeek]);

  if (loading) return <div style={{ padding: '20px' }}>Loading All Player Picks...</div>;

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <h2 style={{ fontSize: '20px', fontWeight: 'bold', marginBottom: '16px' }}>
        All Players' Picks - Week {selectedWeek}
      </h2>

      <div style={{ marginBottom: '16px' }}>
        <label style={{ marginRight: '8px' }}>Select Week:</label>
        <select
          value={selectedWeek || ''}
          onChange={(e) => setSelectedWeek(Number(e.target.value))}
        >
          {availableWeeks.map((week) => (
            <option key={week} value={week}>
              Week {week}
            </option>
          ))}
        </select>
      </div>

      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#f0f0f0' }}>
            <th style={thStyle}>Game Name</th>
            <th style={thStyle}>Picks</th>
            <th style={thStyle}>Winning Picks</th>
            <th style={thStyle}>Weekly Points</th>
            <th style={thStyle}>Cumulative</th>
          </tr>
        </thead>
        <tbody>
          {playerData.map((entry, idx) => (
            <tr key={idx}>
              <td style={tdStyle}>{entry.player || 'Unknown'}</td>
              <td style={tdStyle}>
                {Array.isArray(entry.picks)
                  ? entry.picks
                      .map(p => (typeof p === 'string' ? p : p?.pick || '[Invalid]'))
                      .join(', ')
                  : 'No picks submitted'}
              </td>
              <td style={tdStyle}>No data available until Tuesday</td>
              <td style={tdStyle}>N/A</td>
              <td style={tdStyle}>N/A</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const thStyle = {
  padding: '10px',
  borderBottom: '2px solid #ccc',
  textAlign: 'left'
};

const tdStyle = {
  padding: '8px',
  borderBottom: '1px solid #ddd',
  verticalAlign: 'top'
};

export default AllPlayersPicksPage;
